import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

var resultados = {}

class App extends Component {
constructor(){
  super()
  this.state={
    filtrado: false
  }
}

fileHandler(){
    const input = document.querySelector('input[type="file"]')

    let reader = new FileReader()
    reader.readAsText(input.files[0])
    reader.onload = ()=>{
        const lines = reader.result.split('\n').map((line)=>{
            if(typeof line != undefined){
                return { 
                    usuario:line.split(';')[0],
                    data: new Date(this.convertDate(line.split(';')[1]))
                }
                this.filterUser(lines)
            }
        })

    }
}

filterUser(lines){
    lines.forEach((obj)=>{
       if(obj.usuario in resultados){
            if(resultados[obj.usuario].getTime() < obj.data.getTime()){
                resultados[obj.usuario] = obj.data
            }
        }else{
            resultados[obj.usuario] = obj.data
        }
    })
    this.setState({filtrado: true})
}

convertDate(string){
    //Padrão de entrada = dd/mm/yyyy
    if(string){
        let dia = string.split('/')[0]
        let mes = string.split('/')[1]
        let ano = string.split('/')[2]

        return [ano, mes, dia];
    }
}

  render() {
    return (
      <div className="App">
        <input type="file" onChange={this.fileHandler()}></input>
        {this.state.filtrado ? (
          <table>
            <thead>
              <th>Usuário</th>
              <th>Data</th>
            </thead>
            <tbody>
              {resultados.forEach(
                (<tr>
                  <td>{resultados.key}</td>
                  <td>{resultados.value}</td>
                </tr>)
              )}
            </tbody>
          </table>
        ): (
          <table>

          </table>
        ) }
      </div>
    );
  }
}

export default App;
